import React from "react";

const PokeImage = ({ pokemon }) => {
  if (!pokemon) return <div>no pokemon</div>;
  return (
    <div>
      <h1>{pokemon.name}</h1>
      <img src={pokemon.sprites.front_default} />
      <img src={pokemon.sprites.back_default} />
    </div>
  );
};

export default PokeImage;
